// ----- 2️⃣ Giải mã Base64 sang JS -----
function decodeBase64(str) {
    try {
        // decode Base64 sang text
        return decodeURIComponent(escape(atob(str)));
    } catch (e) {
        console.log("[Base64 Decode Error]", e);
        return null;
    }
}

